CREATE DATABASE tiendaApiProducts
GO
USE tiendaApiProducts
GO
CREATE TABLE [Products] (
    [Id] bigint NOT NULL IDENTITY,
    [Category] nvarchar(max) NULL,
    [Size] nvarchar(max) NULL,
    [Price] decimal(18,2) NOT NULL,
    [Title] nvarchar(max) NULL,
    [ArtDescription] nvarchar(max) NULL,
    [ArtDating] nvarchar(max) NULL,
    [ArtId] nvarchar(max) NULL,
    [Artist] nvarchar(max) NULL,
    [ArtistBirthDate] datetime2 NOT NULL,
    [ArtistDeathDate] datetime2 NOT NULL,
    [ArtistNationality] nvarchar(max) NULL,
    CONSTRAINT [PK_Products] PRIMARY KEY ([Id])
);
GO
SET IDENTITY_INSERT [dbo].[Products] ON 
GO
INSERT [dbo].[Products] ([Id], [Category], [Size], [Price], [Title], [ArtDescription], [ArtDating], [ArtId], [Artist], [ArtistBirthDate], [ArtistDeathDate], [ArtistNationality]) VALUES (1, N'Poster', N'48" x 36"', CAST(89.99 AS Decimal(18, 2)), N'Self-portrait', N'Vincent moved to Paris in 1886, after hearing from his brother Theo about the new, colourful style of French painting. Wasting no time, he tried it out in several self-portraits. He did this mostly to avoid having to pay for a model. Using rhythmic brushstrokes in striking colours, he portrayed himself here as a fashionably dressed Parisian.', N'1887', N'SK-A-3262', N'Vincent van Gogh', CAST(N'1853-03-30T00:00:00.0000000' AS DateTime2), CAST(N'1890-07-29T00:00:00.0000000' AS DateTime2), N'Nederlands')
GO
