INSERT [dbo].[Products] ([Id], [Category], [Size], [Price], [Title], [ArtDescription], [ArtDating], [ArtId], [Artist], [ArtistBirthDate], [ArtistDeathDate], [ArtistNationality]) VALUES (51, N'Poster', N'48" x 36"', CAST(89.99 AS Decimal(18, 2)), N'Portrait of a Couple as Isaac and Rebecca, known as ‘The Jewish Bride’', N'Two contemporaries had themselves portrayed by Rembrandt in historicizing costumes as characters from the Bible. The couple’s tender embrace is at the centre of this poignant painting: the man’s loving gesture is returned with a gentle caress. The figures and their poses agree with the study (No 67), only the figure of King Abimelech spying on them is missing. We, the viewers, assume his role as witnesses of their clandestine love.', N'c. 1665 - c. 1669', N'SK-C-216', N'Rembrandt Harmensz. van Rijn', CAST(N'1606-07-15T00:00:00.0000000' AS DateTime2), CAST(N'1669-10-08T00:00:00.0000000' AS DateTime2), N'Noord-Nederlands')
GO
