in this pantry. He must have been fascinated by the plumage’s magnificent markings and dazzling colours:
blue, green and yellow ochre.', N'c. 1639', N'SK-A-3981', N'Rembrandt Harmensz. van Rijn', CAST(N'1606-07-15T00:00:00.0000000' AS DateTime2), CAST(N'1669-10-08T00:00:00.0000000' AS DateTime2), N'Noord-Nederlands')
GO
INSERT [dbo].[Products] ([Id], [Category], [Size], [Price], [Title], [ArtDescription], [ArtDating], [ArtId], [Artist], [ArtistBirthDate], [ArtistDeathDate], [ArtistNationality]) VALUES (221, N'Poster', N'48" x 36"', CAST(89.99 AS Decimal(18, 2)), N'Tobit and Anna with the Kid', N'Tobit’s blindness has condemned him and his wife to a life of grinding poverty: his once expensive tabard is
torn and tattered. When Anna comes home with a kid, a reward for her hard work, Tobit thinks she has stolen
it. In desperation, he prays God to grant him a quick death. Anna looks on in bewilderment.', N'1626', N'SK-A-4717', N'Rembrandt Harmensz. van Rijn', CAST(N'1606-07-15T00:00:00.0000000' AS DateTime2), CAST(N'1669-10-08T00:00:00.0000000' AS DateTime2), N'Noord-Nederlands')
GO
