and a ‘tabard’, a fur-lined cloak – the kind of clothing elderly scholars preferred to be portrayed in. Wtenbogaert’s face is more realistically modelled than his hands, which may have been done by a pupil in Rembrandt’s workshop.', N'1633', N'SK-A-4885', N'Rembrandt Harmensz. van Rijn', CAST(N'1606-07-15T00:00:00.0000000' AS DateTime2), CAST(N'1669-10-08T00:00:00.0000000' AS DateTime2), N'Noord-Nederlands')
