INSERT [dbo].[Products] ([Id], [Category], [Size], [Price], [Title], [ArtDescription], [ArtDating], [ArtId], [Artist], [ArtistBirthDate], [ArtistDeathDate], [ArtistNationality]) VALUES (251, N'Poster', N'48" x 36"', CAST(89.99 AS Decimal(18, 2)), N'Musical Company', N'This curious painting refuses to divulge its secrets. The image can be interpreted as an admonition to praise God with singing and music-making, but also as a risqué scene of seduction. The young woman’s gaudy garments and red shoes are in questionable taste, and the old woman looks suspiciously like a procuress. Perhaps the painting contains a warning against immoral conduct.', N'1626', N'SK-A-4674', N'Rembrandt Harmensz. van Rijn', CAST(N'1606-07-15T00:00:00.0000000' AS DateTime2), CAST(N'1669-10-08T00:00:00.0000000' AS DateTime2), N'Noord-Nederlands')
GO
