INSERT [dbo].[Products] ([Id], [Category], [Size], [Price], [Title], [ArtDescription], [ArtDating], [ArtId], [Artist], [ArtistBirthDate], [ArtistDeathDate], [ArtistNationality]) VALUES (271, N'Poster', N'48" x 36"', CAST(89.99 AS Decimal(18, 2)), N'The Denial of St Peter', N'In this nocturnal scene lit by a candle, Peter is recognized by soldiers as a disciple of Christ. He denies this,
however, renouncing his master. Christ, in the murky right background, looks back at Peter, as he is led away
by soldiers. Rembrandt had pupils in his workshop until the very last years of his life. Technical investigations have revealed that he was assisted in this painting.', N'1660', N'SK-A-3137', N'Rembrandt Harmensz. van Rijn', CAST(N'1606-07-15T00:00:00.0000000' AS DateTime2), CAST(N'1669-10-08T00:00:00.0000000' AS DateTime2), N'Noord-Nederlands')
