INSERT [dbo].[Products] ([Id], [Category], [Size], [Price], [Title], [ArtDescription], [ArtDating], [ArtId], [Artist], [ArtistBirthDate], [ArtistDeathDate], [ArtistNationality]) VALUES (281, N'Poster', N'48" x 36"', CAST(89.99 AS Decimal(18, 2)), N'Portrait of Haesje Jacobsdr van Cleyburg', N'Haesje van Cleyburg, the wife of a wealthy Rotterdam beer brewer, is fashionably yet extremely soberly dressed. She has not been made more beautiful than she was: the wrinkles, shadows under her eyes, the
bushy eyebrows, and the greying hair are all rendered with painstaking realism. What makes the portrait so charming is the faint smile that plays across her slightly parted lips.', N'1634', N'SK-A-4833', N'Rembrandt Harmensz. van Rijn', CAST(N'1606-07-15T00:00:00.0000000' AS DateTime2), CAST(N'1669-10-08T00:00:00.0000000' AS DateTime2), N'Noord-Nederlands')
