contrast of light and dark are typical of Rembrandt’s (late) work.', N'1661 - 1662', N'SK-C-1747', N'Rembrandt Harmensz. van Rijn', CAST(N'1606-07-15T00:00:00.0000000' AS DateTime2), CAST(N'1669-10-08T00:00:00.0000000' AS DateTime2), N'Noord-Nederlands')
