INSERT [dbo].[Products] ([Id], [Category], [Size], [Price], [Title], [ArtDescription], [ArtDating], [ArtId], [Artist], [ArtistBirthDate], [ArtistDeathDate], [ArtistNationality]) VALUES (361, N'Poster', N'48" x 36"', CAST(89.99 AS Decimal(18, 2)), N'Self Portrait as the Apostle Paul', N'This is Rembrandt’s first and only self portrait in the guise of a biblical figure. The manuscript and the sword projecting from his cloak are Paul’s traditional attributes. Like the other apostles Rembrandt painted in the same period, Paul too is a real, everyday person. By using his own likeness here Rembrandt encourages a direct bond with the saint.', N'1661', N'SK-A-4050', N'Rembrandt Harmensz. van Rijn', CAST(N'1606-07-15T00:00:00.0000000' AS DateTime2), CAST(N'1669-10-08T00:00:00.0000000' AS DateTime2), N'Noord-Nederlands')
