INSERT [dbo].[Products] ([Id], [Category], [Size], [Price], [Title], [ArtDescription], [ArtDating], [ArtId], [Artist], [ArtistBirthDate], [ArtistDeathDate], [ArtistNationality]) VALUES (391, N'Poster', N'48" x 36"', CAST(89.99 AS Decimal(18, 2)), N'Portrait of a Woman, Possibly Maria Trip', N'The young sitter is assumed to be Maria Trip, the daughter of a wealthy Amsterdam merchant. She displays
her wealth with pride. Her dress is trimmed with white linen so fine it is almost transparent. She sports a fortune in pearls, and in her left hand she casually holds the knobbed handle of a folding fan. In 1639 this
was still a rare and costly accessory.', N'1639', N'SK-C-597', N'Rembrandt Harmensz. van Rijn', CAST(N'1606-07-15T00:00:00.0000000' AS DateTime2), CAST(N'1669-10-08T00:00:00.0000000' AS DateTime2), N'Noord-Nederlands')
