INSERT [dbo].[Products] ([Id], [Category], [Size], [Price], [Title], [ArtDescription], [ArtDating], [ArtId], [Artist], [ArtistBirthDate], [ArtistDeathDate], [ArtistNationality]) VALUES (401, N'Poster', N'48" x 36"', CAST(89.99 AS Decimal(18, 2)), N'Self-portrait', N'Even as an inexperienced young artist, Rembrandt did not shy away from experimenting. Here the light
glances along his right cheek, while the rest of his face is veiled in shadow. It takes a while to realize that the
artist is gazing intently out at us. Using the butt end of his brush, Rembrandt made scratches in the still wet
paint to accentuate the curls of his tousled hair.', N'c. 1628', N'SK-A-4691', N'Rembrandt Harmensz. van Rijn', CAST(N'1606-07-15T00:00:00.0000000' AS DateTime2), CAST(N'1669-10-08T00:00:00.0000000' AS DateTime2), N'Noord-Nederlands')
GO
