INSERT [dbo].[Products] ([Id], [Category], [Size], [Price], [Title], [ArtDescription], [ArtDating], [ArtId], [Artist], [ArtistBirthDate], [ArtistDeathDate], [ArtistNationality]) VALUES (421, N'Poster', N'48" x 36"', CAST(89.99 AS Decimal(18, 2)), N'Portrait de Marten Soolmans', N'Marten était le fils d’un riche immigrant flamand, propriétaire d’une prospère raffinerie de sucre à Amsterdam. Plein d’assurance, il posa en 1634 pour Rembrandt qui était alors l’un des peintres portraitistes les plus sollicités d’Amsterdam. Les deux hommes s’étaient probablement rencontrés dans la ville de Leyde où Marten avait fait auparavant des études de droit. Son costume exubérant, garni de dentelle coûteuse et d’extravagantes rosettes à ses souliers, lui valurent au XIXe siècle le qualificatif de ‘dandy’.', N'1634', N'SK-A-5033', N'Rembrandt Harmensz. van Rijn', CAST(N'1606-07-15T00:00:00.0000000' AS DateTime2), CAST(N'1669-10-08T00:00:00.0000000' AS DateTime2), N'Noord-Nederlands')
GO
