INSERT [dbo].[Products] ([Id], [Category], [Size], [Price], [Title], [ArtDescription], [ArtDating], [ArtId], [Artist], [ArtistBirthDate], [ArtistDeathDate], [ArtistNationality]) VALUES (430, N'T-Shirt', N'3XL', CAST(34.99 AS Decimal(18, 2)), N'Portrait de Marten Soolmans', N'Marten était le fils d’un riche immigrant flamand, propriétaire d’une prospère raffinerie de sucre à Amsterdam. Plein d’assurance, il posa en 1634 pour Rembrandt qui était alors l’un des peintres portraitistes les plus sollicités d’Amsterdam. Les deux hommes s’étaient probablement rencontrés dans la ville de Leyde où Marten avait fait auparavant des études de droit. Son costume exubérant, garni de dentelle coûteuse et d’extravagantes rosettes à ses souliers, lui valurent au XIXe siècle le qualificatif de ‘dandy’.', N'1634', N'SK-A-5033', N'Rembrandt Harmensz. van Rijn', CAST(N'1606-07-15T00:00:00.0000000' AS DateTime2), CAST(N'1669-10-08T00:00:00.0000000' AS DateTime2), N'Noord-Nederlands')
GO
INSERT [dbo].[Products] ([Id], [Category], [Size], [Price], [Title], [ArtDescription], [ArtDating], [ArtId], [Artist], [ArtistBirthDate], [ArtistDeathDate], [ArtistNationality]) VALUES (431, N'Poster', N'48" x 36"', CAST(89.99 AS Decimal(18, 2)), N'Portrait of Oopjen Coppit', N'In contrast to the newcomer Marten, Oopjen’s family had already been living in Amsterdam for generations. Her grandfather had made his fortune trading grain and gunpowder, and her father belonged to Amsterdam’s small group of powerful rulers. Even though Oopjen’s clothing is less modern than Marten’s, with her black silk gown and expensive jewellery she was certainly showing off her wealth.', N'1634', N'SK-C-1768', N'Rembrandt Harmensz. van Rijn', CAST(N'1606-07-15T00:00:00.0000000' AS DateTime2), CAST(N'1669-10-08T00:00:00.0000000' AS DateTime2), N'Noord-Nederlands')
GO
