INSERT [dbo].[Products] ([Id], [Category], [Size], [Price], [Title], [ArtDescription], [ArtDating], [ArtId], [Artist], [ArtistBirthDate], [ArtistDeathDate], [ArtistNationality]) VALUES (441, N'Poster', N'48" x 36"', CAST(89.99 AS Decimal(18, 2)), N'The Milkmaid', N'A maidservant pours milk, entirely absorbed in her work. Except for the stream of milk, everything else is still. Vermeer took this simple everyday activity and made it the subject of an impressive painting – the woman stands like a statue in the brightly lit room. Vermeer also had an eye for how light by means of hundreds of colourful dots plays over the surface of objects.', N'c. 1660', N'SK-A-2344', N'Johannes Vermeer', CAST(N'1632-10-31T00:00:00.0000000' AS DateTime2), CAST(N'1675-12-15T00:00:00.0000000' AS DateTime2), N'Noord-Nederlands')
GO
