INSERT [dbo].[Products] ([Id], [Category], [Size], [Price], [Title], [ArtDescription], [ArtDating], [ArtId], [Artist], [ArtistBirthDate], [ArtistDeathDate], [ArtistNationality]) VALUES (481, N'Poster', N'48" x 36"', CAST(89.99 AS Decimal(18, 2)), N'Young Woman in Fantasy Costume', N'The young woman’s clothing is not in keeping with the fashions of Rembrandt’s day, but rather reflects styles of earlier centuries. The woman’s distinctive features – a domed forehead, slightly bulging eyes, and
pronounced chin – are easily recognized in depictions of ancient goddesses and heroines that Rembrandt
painted in the 1630s. Thus the painting is not strictly a portrait, but a ‘tronie’, or fantasy head.', N'1633', N'SK-A-4057', N'Rembrandt Harmensz. van Rijn', CAST(N'1606-07-15T00:00:00.0000000' AS DateTime2), CAST(N'1669-10-08T00:00:00.0000000' AS DateTime2), N'Noord-Nederlands')
