INSERT [dbo].[Products] ([Id], [Category], [Size], [Price], [Title], [ArtDescription], [ArtDating], [ArtId], [Artist], [ArtistBirthDate], [ArtistDeathDate], [ArtistNationality]) VALUES (501, N'Poster', N'48" x 36"', CAST(89.99 AS Decimal(18, 2)), N'Rembrandt’s Son Titus in a Monk’s Habit', N'Rembrandt’s son Titus was probably the model for this ‘portrait’ of a Franciscan monk. His downcast eyes lend him an air of quiet introspection. His serene, pale face stands out clearly against a backdrop of green and brown vegetation.Solitary retreat into nature for prayer and reflection was of great importance to Saint Francis and his order.', N'1660', N'SK-A-3138', N'Rembrandt Harmensz. van Rijn', CAST(N'1606-07-15T00:00:00.0000000' AS DateTime2), CAST(N'1669-10-08T00:00:00.0000000' AS DateTime2), N'Noord-Nederlands')
