INSERT [dbo].[Products] ([Id], [Category], [Size], [Price], [Title], [ArtDescription], [ArtDating], [ArtId], [Artist], [ArtistBirthDate], [ArtistDeathDate], [ArtistNationality]) VALUES (511, N'Poster', N'48" x 36"', CAST(89.99 AS Decimal(18, 2)), N'An Old Woman Reading, Probably the Prophetess Hannah', N'Light comes in from behind the old woman: the vivid glow illuminates the book and her hand, so thickly painted that the wrinkles seem almost modelled in clay. Her face remains in shadow. The woman could be the biblical prophetess Hannah. According to the Gospel of Luke, she was an elderly widow who worshipped God night and day with fasting and prayer.', N'1631', N'SK-A-3066', N'Rembrandt Harmensz. van Rijn', CAST(N'1606-07-15T00:00:00.0000000' AS DateTime2), CAST(N'1669-10-08T00:00:00.0000000' AS DateTime2), N'Noord-Nederlands')
GO
