INSERT [dbo].[Products] ([Id], [Category], [Size], [Price], [Title], [ArtDescription], [ArtDating], [ArtId], [Artist], [ArtistBirthDate], [ArtistDeathDate], [ArtistNationality]) VALUES (611, N'Poster', N'48" x 36"', CAST(89.99 AS Decimal(18, 2)), N'Samson and Delilah', N'This scene represents the biblical story of the Israelite Samson and the Philistine Delilah. Delilah seduced Samson and lured him into revealing the secret of his superhuman strength, which he would lose if his hair were cut. Without his long hair he would be like any other mortal. Rembrandt painted Samson asleep on Delilah’s lap. She grasps Samson’s hair and signals the approaching man with scissors to be quiet.', N'c. 1626 - c. 1630', N'SK-A-4096', N'Rembrandt Harmensz. van Rijn', CAST(N'1606-07-15T00:00:00.0000000' AS DateTime2), CAST(N'1669-10-08T00:00:00.0000000' AS DateTime2), N'Noord-Nederlands')
GO
