INSERT [dbo].[Products] ([Id], [Category], [Size], [Price], [Title], [ArtDescription], [ArtDating], [ArtId], [Artist], [ArtistBirthDate], [ArtistDeathDate], [ArtistNationality]) VALUES (631, N'Poster', N'48" x 36"', CAST(89.99 AS Decimal(18, 2)), N'Man in Oriental Dress', N'Rembrandt manipulated light in a highly personal way. Here, the man’s turban and the right side of his face are brilliantly illuminated, while the left side is in shadow. Exotic character heads like this – they are not portraits – were extremely popular in the 17th century; early on, they were widely copied and imitated. They
were known as ‘Turkish tronies’.', N'1635', N'SK-A-3340', N'Rembrandt Harmensz. van Rijn', CAST(N'1606-07-15T00:00:00.0000000' AS DateTime2), CAST(N'1669-10-08T00:00:00.0000000' AS DateTime2), N'Noord-Nederlands')
