INSERT [dbo].[Products] ([Id], [Category], [Size], [Price], [Title], [ArtDescription], [ArtDating], [ArtId], [Artist], [ArtistBirthDate], [ArtistDeathDate], [ArtistNationality]) VALUES (651, N'Poster', N'48" x 36"', CAST(89.99 AS Decimal(18, 2)), N'The Conspiracy of the Batavians under Claudius Civilis', N'Resolved to overthrow Roman domination, the Batavians enter into a treaty in a nocturnal ritual. This rebellion took place in 69 AD and was led by the one-eyed Batavian chieftain Claudius Civilis, here portrayed centrally. Rembrandt depicts the moment when the Batavians swear their oath by striking their swords together and raising the beaker. The rough facture and powerful
