is composed of elements studied from reality, it probably does not represent a specific place. The painting’s
magical quality derives from its dramatic illumination: a beam of sunlight breaks through the clouds, making
the approaching storm seem twice as menacing.', N'c. 1638', N'SK-A-1935', N'Rembrandt Harmensz. van Rijn', CAST(N'1606-07-15T00:00:00.0000000' AS DateTime2), CAST(N'1669-10-08T00:00:00.0000000' AS DateTime2), N'Noord-Nederlands')
