INSERT [dbo].[Products] ([Id], [Category], [Size], [Price], [Title], [ArtDescription], [ArtDating], [ArtId], [Artist], [ArtistBirthDate], [ArtistDeathDate], [ArtistNationality]) VALUES (681, N'Poster', N'48" x 36"', CAST(89.99 AS Decimal(18, 2)), N'The Love Letter', N'Vermeer chose an unusual vantage point for this painting. From a dim space in the foreground, a glimpse is afforded of another room with a domestic scene. An elegantly dressed woman looks up expectantly at a maidservant, who has just handed her a letter. The seascape on the wall behind them may well allude to the epistle’s subject: during the 17th century, the sea was often compared to love, and the lover to a ship.', N'c. 1669 - c. 1670', N'SK-A-1595', N'Johannes Vermeer', CAST(N'1632-10-31T00:00:00.0000000' AS DateTime2), CAST(N'1675-12-15T00:00:00.0000000' AS DateTime2), N'Noord-Nederlands')
GO
