INSERT [dbo].[Products] ([Id], [Category], [Size], [Price], [Title], [ArtDescription], [ArtDating], [ArtId], [Artist], [ArtistBirthDate], [ArtistDeathDate], [ArtistNationality]) VALUES (711, N'Poster', N'48" x 36"', CAST(89.99 AS Decimal(18, 2)), N'Woman Reading a Letter', N'Enjoying a quiet, private moment, this young woman is absorbed in reading a letter in the morning light. She is still wearing her blue night jacket. All of the colours in the composition are secondary to its radiant lapis lazuli blue. Vermeer recorded the effects of light with extraordinary precision. Particularly innovative is his rendering of the woman’s skin with pale grey, and the shadows on the wall using light blue.', N'c. 1663', N'SK-C-251', N'Johannes Vermeer', CAST(N'1632-10-31T00:00:00.0000000' AS DateTime2), CAST(N'1675-12-15T00:00:00.0000000' AS DateTime2), N'Noord-Nederlands')
GO
