INSERT [dbo].[Products] ([Id], [Category], [Size], [Price], [Title], [ArtDescription], [ArtDating], [ArtId], [Artist], [ArtistBirthDate], [ArtistDeathDate], [ArtistNationality]) VALUES (741, N'Poster', N'48" x 36"', CAST(89.99 AS Decimal(18, 2)), N'View of Houses in Delft, Known as The Little Street', N'This is an unusual painting in Vermeer’s oeuvre, and remarkable for its time as a portrait of ordinary houses. The composition is as exciting as it is balanced. The old walls with their bricks, whitewash, and cracks are almost tangible. The location is Vlamingstraat 40–42 in Delft. Vermeer’s
aunt Ariaentgen Claes lived in the house at the right, with her children, from around 1645 until her death in 1670.', N'c. 1658', N'SK-A-2860', N'Johannes Vermeer', CAST(N'1632-10-31T00:00:00.0000000' AS DateTime2), CAST(N'1675-12-15T00:00:00.0000000' AS DateTime2), N'Noord-Nederlands')
GO
